import React from 'react';
import {render} from 'react-dom';
import {Router,Route,Switch} from 'react-router-dom';
import Bubblesort from './Bubblesort';
import Insertionsort from './Insertionsort';
import Selectionsort from './Selectionsort';
import Mergesort from './Mergesort';
import Navbar from './Navbar';
// import vlogo from './vlogo.jpg';
// import Navlistarray from './Navlistarray';
// import Navlist from './Navlist';
// import Darray from './Darray';
// import Restartbtn from './Restartbtn';
// import Startbtn from './Startbtn';
// import { setArray } from './Darray';
function App(){
  return (
    <>
    <Navbar/>
    <br/>
    <Router>
    <switch>
      {/* <Route exact path="/" component={Home}/> */}
      <Route exact path="/" component={Bubblesort}/>
      <Route exact path="/Insertionsort" component={Insertionsort}/>
      <Route exact path="/Selectionsort" component={Selectionsort}/>
      <Route exact path="/Mergesort" component={Mergesort}/>
      {/* <Route exact path="/" component={}/> */}
    </switch>
    </Router>
    {/* <Bubblesort/> */}
    </>
  );

}
export default App;
// export {Darray};
